Kassirer // entrance by donation, all money goes to Kay",image:"word_church.jpg",id:17},{startDate:s("August 20 16 5 PM","MMMM DD YY h:mm A"),endDate:null,title:"The Burning Tale: Chapter XVII, featuring Kay Kassirer",location:"Studio Bongiorno - 500 Lincoln St, Santa Clara, California",linkToEvent:"https://www.facebook.com/events/1133347880054950/",blurb:"5–7pm: Mighty Mike McGee will facilitate a writing workshop at Studio Bongiorno for writers of all shapes and sizes.\n        Admission is $5 and is split between the venue and the facilitator. //\n        7–9pm: Potluck & open-mic sign-up. Bring a dish and mingle! //\n        9–11:59+ — The Burning Tale: Chapter XVII. Admission is $5. Featuring special guest, Kay Kassirer",image:"burning_tale.jpg",id:18},{startDate:s("September 22 16 8 PM","MMMM DD YY h:mm A"),endDate:null,title:"Tongues of Fire featuring Kay Kassirer",location:"Wheelies Motorcycles & Cafe -  2620 Rock Bay Ave, Victoria, BC",linkToEvent:"https://www.facebook.com/events/1598083047150883/",blurb:"Tongues of Fire is our twice monthly spoken word open mic with a feature performance.\n        There are 12 spots on the open mic and each performer gets 5 minutes maximum. Sign up for the open mic is\n        at 7:30pm and the show starts at 8pm. Suggested donation: $6-10 sliding scale.",image:"tof.jpeg",id:19},{startDate:s("September 11 16 6:30 PM","MMMM DD YY h:mm A"),endDate:null,title:"Portland Poetry Slam featuring Kay Kassirer",location:"Portland Center Stage at The Armory - 128 NW 11th Ave Portland, OR",linkToEvent:"https://www.facebook.com/events/1200766623298778/",blurb:"6:30 PM/suggested donation $5/Portland Center Stage/all ages --- also Where Are You Press is\n        running a FREE, OPEN TO THE PUBLIC writing workshop before every slam! It is at 5 PM - you come to Portland\n        Center Stage and ask the concierge and you get to go to a fancy hidden room and have interesting and educational\n        discussions and prompts about writing and how to do it bigger, weirder, better.",image:"portland.jpg",id:20},{startDate:s("September 6 16 7:30 PM","MMMM DD YY h:mm A"),endDate:null,title:"Seattle Poetry Slam presents the first WOWPS Qualifier!",location:"Seattle Poetry Slam - 1114 Howell St, Seattle, Washington",linkToEvent:"https://www.facebook.com/events/1322413457798688/",blurb:'Doors @ 7pm, Show @ 7:30pm // a DOUBLE feature: Marshall "Gripp" Gillson and Kay Kassirer // an open mic\n        (OPEN to ALL Poets) // and the first Woman of the World Poetry Slam Qualifier!  // $5 // 21 + ID required //\n        **Competition at WOWps is limited to poets who live their lives as women. Qualified poets include female assigned\n        or identified individuals who are PSi members and are 18+ years of age, including gender\n        non-conforming individuals.**',image:"seattle_wowps.jpg",id:21},{startDate:s("September 15 16 6:45 PM","MMMM DD YY h:mm A"),endDate:null,title:"Slamapalooza September 2016 - Featuring Kay Kassirer",location:"KSA GrassRoots Cafe - 12666 72nd Avenue, Surrey, British Columbia",linkToEvent:"https://www.facebook.com/events/620730448102203/",blurb:"The new semester has started and so begins the new season of Slamapalooza!\n        Come join us for our September SEASON OPENER! As always the slam will consist of two\n        3 minute rounds separated by a performance by our amazing feature performer Kay Kassirer!\n        Signup for the slam happen from 6:30pm-7:15pm.\n        The cafe and washrooms are wheelchair accessible, however the stage is not.",image:"slam-a-palooza.jpg",id:22},{startDate:s("September 19 16 7:00 PM","MMMM DD YY h:mm A"),endDate:null,title:"Kay Kassirer features at the Van Slam",location:"Cafe Deux Soleils - 2096 Commercial Drive, Vancouver, British Columbia",linkToEvent:"https://www.facebook.com/events/657478454408982/",blurb:"A two-minute round of 12 poets, a one-minute round of 6 poets,\n        and then a four-minute round of 3 poets. Cut from below, clean slate each round.\n        Cafe Deux Soleils and the Van Slam strive to be a trans friendly place and a hate speech\n        free zone. Help us with that. We also acknowledge that this event takes place on unceded\n        First Nations Territory // cash ONLY // Get there before 7pm if you want a seat or want to slam",image:"vps.jpg",id:23},{startDate:s("October 12 16","MMMM DD YY"),endDate:s("October 15 16","MMMM DD YY"),title:"Individual World Poetry Slam",location:"Flagstaff, AZ",linkToEvent:"http://iwps.poetryslam.com/",blurb:"The Individual World Poetry Slam is a four day poetry slam\n        festival created by PSi giving poets the opportunity to compete outside\n        of a team competition for the title of the Individual World Poetry Slam\n        Champion. The event brings world acclaimed feature performers,\n        poetry and performance workshops, specialty slams, open mics, and events\n        for all ages to Flagstaff, AZ. Kay came 25th out of 96 poets.",image:"iwps.jpg",id:24},{startDate:s("October 23 16","MMMM DD YY"),endDate:s("October 30 16","MMMM DD YY"),title:"Canadian Festival of Spoken Word",location:"Winnipeg, Manitoba",linkToEvent:"http://cfsw.ca/",blurb:"From Oct 23-30 the biggest poetry slam tournament in the country,\n        featuring 22 teams from Halifax to Victoria, will be held amongst a week\n        of showcases, workshops and parties. Kay made it to the final round at\n        Underground Indies/NUPIC.",image:"cfsw.jpg",id:25},{startDate:s("November 5 16 7:00 PM","MMMM DD YY h:mm A"),endDate:null,title:"2016 Cascadia Regional Poetry Slam",location:"5608 Rainier Ave S, Seattle, Washington",linkToEvent:"https://www.facebook.com/events/1749495215310429/permalink/1771405956452688/",blurb:"The Cascadia Regional Poetry Slam brings together teams from all\n        over the Northwest to compete in a tournament of the region's finest performance poetry. ",image:"cascadia.jpg",id:27},{startDate:s("January 5 17 6:00 PM","MMMM DD YY h:mm A"),endDate: